import React from 'react'
import { useParams } from 'react-router-dom'

const Rout = () =>{
    const {id} = useParams();
    return(
        <div>
            <h1>Test</h1>
            <p>{JSON.stringify(id)} Is Not Available</p>
        </div>
    )
}

export default Rout
